import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/layout/navbar";
import Landing from "./components/layout/landing";
class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello</h1>
        <navbar/>
        <landing/>
      </div>
    );
  }
}
export default App;
